import React, { useState, useEffect } from 'react';
import { Container, Row, Col, Breadcrumb, Spinner, Card } from 'react-bootstrap';
import { useParams, useLocation } from 'react-router-dom';
import globalVar from '../globalVar'; // Ensure this path is correct

const useQuery = () => {
    return new URLSearchParams(useLocation().search);
};

const ExamAvailability = () => {
    const { certificationId } = useParams();
    const query = useQuery();
    const vendorId = query.get('vendorId');
    const [exams, setExams] = useState([]);
    const [certificateDetail, setCertificateDetail] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
            setLoading(true);
            const requestOptions = {
                method: "POST",
                headers: { "Content-Type": "application/json" },
                body: JSON.stringify({ certificationId })
            };

            try {
                // Fetch certificate details
                const certificateResponse = await fetch(globalVar.url + 'certificate_detail', requestOptions);
                if (!certificateResponse.ok) throw new Error('Certificate details fetch failed');
                const certificateData = await certificateResponse.json();
                setCertificateDetail(certificateData.data);

                // Fetch exams
                const examsResponse = await fetch(globalVar.url + 'available_exam', requestOptions);
                if (!examsResponse.ok) throw new Error('Exams fetch failed');
                const examsData = await examsResponse.json();
                setExams(examsData.data);
            } catch (error) {
                setError(error);
            } finally {
                setLoading(false);
            }
        };

        fetchData();
    }, [certificationId]);

    return (
        <section className="section section-exams inner-page">
            <Container>
                {loading ? (
                    <div className='d-flex align-items-center justify-content-center' style={{ height: '250px' }}>
                        <Spinner animation="border" role="status">
                            <span className="visually-hidden">Loading...</span>
                        </Spinner>
                    </div>
                ) : error ? (
                    <div className="alert alert-danger">
                        Error fetching data: {error.message}
                    </div>
                ) : (
                    <>
                        <Breadcrumb>
                            <Breadcrumb.Item href="/">Home</Breadcrumb.Item>
                            <Breadcrumb.Item href="/certificates">Certificates</Breadcrumb.Item>
                            <Breadcrumb.Item active>Exam Availability</Breadcrumb.Item>
                        </Breadcrumb>

                        <div className='mb-4'>
                            {certificateDetail ? (
                                <>
                                    <h2 className="title page-title d-flex align-items-center">
                                        <span>{certificateDetail.certification_Name}</span>
                                        <span className='d-inline-flex ms-3'>
                                            <span className='certificateStatus-tag'>{certificateDetail.status}</span>
                                        </span>
                                    </h2>
                                    <p>{certificateDetail.detail}</p>
                                </>
                            ) : (
                                <div className="alert alert-info">
                                    No certificate details available.
                                </div>
                            )}
                        </div>

                        <Row>
                            {exams.length > 0 ? (
                                exams.map((exam) => (
                                    <Col sm={6} lg={4} xl={3} key={exam.examId}>
                                        <Card className="mb-4">
                                            <Card.Body>
                                                <Card.Title>{exam.exam_Name}</Card.Title>
                                                <Card.Text>Status: {exam.status}</Card.Text>
                                                <Card.Text>Updated At: {exam.updated_at}</Card.Text>
                                                <Card.Text>Created At: {exam.created_at}</Card.Text>
                                            </Card.Body>
                                        </Card>
                                    </Col>
                                ))
                            ) : (
                                <Col>
                                    <div className="alert alert-info">
                                        No exams available for this certificate.
                                    </div>
                                </Col>
                            )}
                        </Row>
                    </>
                )}
            </Container>
        </section>
    );
};

export default ExamAvailability;
